import React from 'react'
import { Row, Col} from 'react-bootstrap'
import Products from '../products'
export default function HomeScreen() {
  return (
    <>
        <Row>
        {
                Products.map((val)=>{
                    return (
                        <>
                        <Col>
                            
                        </Col>
                            <h3>{val.name}</h3>
                        </>
                    )
                })
            }
        </Row>
    </>
  )
}
